import React from 'react';
import { Route, Navigate } from 'react-router-dom';
function ProtectedRoute({ element: Component, isLoggedIn, ...rest }) {
  return isLoggedIn ? <Route {...rest} element={Component} /> : <Navigate to="/signup" />;
}

